// App.js
import React from 'react';
import './App.css';
import background from './background.jpg'; // Import your animated background image
import logo from './logo.png'; // Import your logo or any other image

function App() {
  return (
    <div className="App">
      <div className="background-container">
        <img src={background} alt="background" className="background-image" />
      </div>
      <div className="content">
        <img src={logo} alt="logo" className="logo" />
        <h1>Crime Management System</h1>
        <p>Welcome to our platform dedicated to managing crime-related information.</p>
      </div>
    </div>
  );
}

export default App;
